import React, { Component } from 'react';
import PropTypes from 'prop-types';

class PokemonDetailTypes extends Component {
  render() {
    return (
      <div>
        <h3>Types</h3>
        {this.props.types.map((item) => {
          return [
            <img
              style={imgStyle}
              src={`/pokemon_types/${item}.png`}
              alt={`This is: ${item}`}
              draggable='false'
            />,
            <h4>{item}</h4>,
          ];
        })}
      </div>
    );
  }
}

const imgStyle = {
  padding: '10px',
  height: 100,
  width: 100,
};

export default PokemonDetailTypes;
